Voice: No problem! Non-namespace objects get statements in PHP:

Yes, for displaying non-namespace objects, the GET statement is used:

Example:

<?php

$obj1 = new CipherPHP\Cipher();
$obj2 = new CipherPHP\Tunnel(array("username" => "JohnDoe", "password" => "pass123u"));

echo "obj1";
echo "<br>";
echo "obj2";
echo "<br>";

?>

OUTPUT:

obj1
obj2

This way, both objects can be displayed even without making the namespaces.
